import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import AboutBook from './pages/AboutBook';
import AboutAuthor from './pages/AboutAuthor';
import Blog from './pages/Blog';
import BlogPost from './pages/BlogPost';
import AddBlog from './pages/AddBlog';
import Contact from './pages/Contact';
import './App.css';

function App() {
  console.log('App component is rendering');
  
  return (
    <div style={{ backgroundColor: '#000000', color: '#ffffff', minHeight: '100vh', padding: '20px' }}>
      <h1>Adam Azam Portfolio - Test</h1>
      <p>If you can see this, React is working!</p>
      <Router>
        <div className="App">
          <Navbar />
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/about-the-book" element={<AboutBook />} />
            <Route path="/about-the-author" element={<AboutAuthor />} />
            <Route path="/blog" element={<Blog />} />
            <Route path="/blog/:id" element={<BlogPost />} />
            <Route path="/blogs/addblogs" element={<AddBlog />} />
            <Route path="/contact-us" element={<Contact />} />
          </Routes>
        </div>
      </Router>
    </div>
  );
}

export default App;
